import React from "react";
import "./App.css";
import Nav from "./Nav";

function ContactUs() {
  return (
    <div>
      <Nav />
      <br />
      <br />
      <br />
      <div className="body">
        <header>
          <h2 className="head"> Contact Us </h2>
        </header>
      </div>
    </div>
  );
}

export default ContactUs;
